import{_ as a,o,c as s,z as e,a as t}from"./chunks/framework.9482e208.js";const w=JSON.parse('{"title":"§ 17.1-614 List of entries made on behalf of witnesses.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/17.1-614.md","filePath":"vacode/17.1-614.md"}'),n={name:"vacode/17.1-614.md"},r=e("h1",{id:"§-17-1-614-list-of-entries-made-on-behalf-of-witnesses",tabindex:"-1"},[t("§ 17.1-614 List of entries made on behalf of witnesses. "),e("a",{class:"header-anchor",href:"#§-17-1-614-list-of-entries-made-on-behalf-of-witnesses","aria-label":'Permalink to "§ 17.1-614 List of entries made on behalf of witnesses."'},"​")],-1),i=e("p",null,"The clerk shall, immediately after the adjournment of any court, make out two lists of all entries made on behalf of witnesses attending for the Commonwealth, and certify one to the Supreme Court and the other to the county or city treasurer, to which lists shall be attached a certificate to the correctness of the allowances therein and the aggregate amount thereof signed by the judge of the court and by the clerk. Any dispute before or after issuing the certificate between the witness and the party against whom his claim is made as to its justice or amount may, when the case is in a court, be determined by such court. The Comptroller shall not issue a warrant for any claim allowed by a court to a witness unless it appears upon the list certified as herein provided, and, upon the payment of any such claim, the date of approval by the Supreme Court shall be noted on such list.",-1),h=e("p",null,[t("Code 1950, § 14-189; 1964, c. 386, § 14.1-192; 1978, c. 195; 1998, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0872",target:"_blank",rel:"noreferrer"},"872"),t(".")],-1),l=[r,i,h];function c(d,f,m,u,p,_){return o(),s("div",null,l)}const y=a(n,[["render",c]]);export{w as __pageData,y as default};
